import React from 'react'
import styled from 'styled-components'

const Container = styled.div`

    display: flex;
    height: 100vh;
    justify-content: center;
`;

const FormWrapper = styled.div`
    border: solid;
    margin: auto;
`;

const Form = styled.form`
    display: flex;
    flex-direction: column;
    height: 200px;
    width: 800px;
`;

const FormLabel = styled.label`

    align-self: center;
`;

const InputWrapper = styled.div`
    align-self: center;
    align-items: center;

    height: 90%;
    width: 100%;
    border: solid;
`;

const InputFlex = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;

    width: 50%;
    border: solid;
    border-color: red;
`;

const Input = styled.input`
    margin: 5px;
`;


const Register = () => {
  return (
    <Container>
          <FormWrapper>
              <Form>
                  <FormLabel>Create An Account</FormLabel>
                  <InputWrapper>
                    <InputFlex>
                        <Input></Input>
                          <Input></Input>
                          <Input></Input>

                    </InputFlex>
                    <InputFlex>
                        <Input></Input>
                          <Input></Input>
                          <Input></Input>

                    </InputFlex>

                  </InputWrapper>




              </Form>
          </FormWrapper>
    </Container>
  )
}

export default Register
